window.bookSummaryJSON = "<p>For well over a century, Monster Hunter International has kept the world safe from supernatural threats small and large - and, in some cases, very, very large. Now, join us as MHI opens their archives for the first time. From experienced hunters on their toughest cases to total newbies' initial encounters with the supernatural, <i>The Monster Hunter Files</i> reveals the secret history of the world's most elite monster fighting force. </p> <p>Discover what happened when Agent Franks took on the Nazis in World War II. Uncover how the Vatican's Combat Exorcists deal with Old Ones in Mexico. And find out exactly what takes place in a turf war between trailer park elves and gnomes. From the most powerful of mystical beings to MHI's humble janitor, see the world of professional monster hunting like never before. </p> <p>Featuring 17 all new tales based on Larry Correia's best-selling series, from <i>New York Times</i> best-selling authors Jim Butcher, John Ringo, Jessica Day George, Jonathan Maberry, Faith Hunter, and many more. </p> <p>Also includes stories by Larry Correia, John C. Wright, Jody Lynn Nye, Mike Kupari, and Brad R. Torgersen. </p>"; 
